  }}>
     <div className='train2'>
              <p>
              Artist:-{props.name}
              <br/>
              price: {props.price}<br/>
              date:{props.date}<br/>
              Venue:{props.Location}
              
            </p>
            </div>
            <button className='train1' onClick={<Media1/>}>Book</button>
  </div>




  );
